import myFooter from '~/components/Footer'
// this.$refs.alert.setMessage(false,'message',function(){})
export default {
	components:{
		'alert': Alert,
		'myheader': myHeader,
		'myfooter': myFooter
	},
	asyncData:function(context){
		var obj={};
	    obj.id =context.params.id;
		return obj;
  	},
	data : function() {
		return {
		    loginFlag:false,
		    obj:{
		      pageNum:1,
		      pageSize:10,
		      sort:0,
		    },
		    objSec:{
		      pageNum:1,
		      pageSize:10,
		      sort:1,
		    },
		    hotList:[],
		    newList:[],
		    path: PathList,
		    pages:'',
		    laudNum:'',
		    LaudFlag:false,
		    loveFlag:false,
		    follow:false,
		    search:''
		}
    },
    mounted: function () { // 初始化
		this.$nextTick(function () {
			var swiper = new Swiper('.swiper-container', {
			    pagination: '.swiper-pagination',
			    nextButton: '.swiper-button-next',
			    prevButton: '.swiper-button-prev',
			    slidesPerView: 1,
			    paginationClickable: true,
			    spaceBetween: 30,
			    autoplay : 3000,
				speed:300,
			    loop: true
			});
			this.getValueFn();
		})
	},
	methods: { // 方法体
	    batchFn:function(a){
	      if( a == 1 && this.obj.pageNum < this.pages ){
	          this.obj.pageNum += 1;
	          SZXJ.http(this,'get', PathList.listAlbums,this.obj, (response) => { 
	             this.hotList = response.data.data.list;
	             this.pages = response.data.data.pages;
	          });
	      }else if( a == 1 && this.obj.pageNum == this.pages){
	          this.obj.pageNum = 1;
	          SZXJ.http(this,'get', PathList.listAlbums,this.obj, (response) => { 
	             this.hotList = response.data.data.list;
	             this.pages = response.data.data.pages;
	          });
	      }else if( a == 2 && this.objSec.pageNum < this.pages ){
	          this.objSec.pageNum += 1;
	          SZXJ.http(this,'get', PathList.listAlbums,this.objSec, (response) => { 
	             this.newList = response.data.data.list;
	             this.pages = response.data.data.pages;
	          });
	      }else if( a == 2 && this.obj.pageNum == this.pages){
	          this.objSec.pageNum = 1;
	          SZXJ.http(this,'get', PathList.listAlbums,this.objSec, (response) => { 
	             this.newList = response.data.data.list;
	             this.pages = response.data.data.pages;
	          });
	      }
    	},
    	setAttention: function(a,b,c){
		    SZXJ.http(this,'post', PathList.saveOrCancelAttention, {receiveId:a}, (response) => {
			    if( c == 1){
			        this.hotList[b].isFans = 1;
			    }else{
			        this.hotList[b].isFans = 0;
			    }
		    },(err)=>{
		      	this.$refs.alert.setMessage(true, err.body.msg,function(){
		      		location.href='/login';
		      	});
	      	});
    	},
	    searchFn:function(){
	      	location.href = encodeURI('/painter/works/' + this.search) ;
	    },
	    giveLaudFn:function(a,b){
	    	var self = this;
		    SZXJ.http(this,'get', PathList.giveLaud,{albumId:a}, (response) => {  
		        this.newList[b].laudAmount += 1;
		        this.newList[b].hasLaud = 1;
		    },(err)=>{
		      	this.$refs.alert.setMessage(true, err.body.msg,function(){
		      		
		      	});
		    });
	    },
	    getValueFn:function(){
	      SZXJ.http(this,'get', PathList.listAlbums,this.obj, (response) => { 
	           this.hotList = response.data.data.list;
	           this.pages = response.data.data.pages;
	      });
	      SZXJ.http(this,'get', PathList.listAlbums,this.objSec, (response) => { 
	           this.newList = response.data.data.list; 
	           this.pages = response.data.data.pages;
	      });
	      SZXJ.http(this,'get', PathList.getStatus, {}, (response) => {
	        this.loginFlag = response.data.loginFlag;
	      });
	    }
  	},
